import * as React from 'react';
import { useContext } from 'react';
import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';

export default function UsernamesList(props:{list:{name:string, price:string}[]}) {
    
  const [selectedIndex, setSelectedIndex] = React.useState(0);

  const handleListItemClick = (
    event: React.MouseEvent<HTMLDivElement, MouseEvent>,
    index: number,
  ) => {
    setSelectedIndex(index);
  };

  return (
    <Box sx={{ width: '25%', maxWidth: 360, bgcolor: 'background.paper' }}>
      <Divider />
      <List component="nav" aria-label="usernames list">
        {props.list.map((item)=> <ListItemButton
          selected={selectedIndex === 0}
          onClick={(event) => handleListItemClick(event, 0)}
        >
          <ListItemText primary={item.name} secondary={item.price}/>
        </ListItemButton>)}
      </List>
    </Box>
  );
}
